import React, { useContext } from 'react'
import axios from 'axios';
import { Context } from '../../../pages/MainPage/MainPage';


function Snacks() {
const {DrinksCards, setDrinksCards} = useContext(Context)
 
 React.useEffect(() => {
    if (DrinksCards.length === 0) {
      axios
        .get('https://demo5518646.mockable.io/DrinksCard')
        .then((res) => {
          setDrinksCards(res.data);
          console.log(res.data);

        });
    }
  }, []);

  return (
      <div>
        <h1 className={styles.MenuDrinks}>Все Напитки</h1>
        <div className={styles.inline}>
  {Array.isArray(DrinksCards) && DrinksCards.length > 0 && DrinksCards.map((card) => (
    <div key={card.id}><h1>{card.name}</h1></div>
  ))}
</div>

      </div>
  )
}

export default Snacks
